import React, { useState, useEffect } from "react";
import axios from "axios";

const Component1 = () => {
  const [data, setData] = useState();

  useEffect(() => {
    axios
      .get("http://localhost:8080/part?id=11")
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  console.log({ data });

  return <div>Component1</div>;
};

export default Component1;
